    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 / + col1 NOT IN ( + + col0 + - - 79 * + col0, col1 / - + col1 * col2 );
  - name: tab1

outputs:
  - name: q6648.out
    data: |
      51	14	96
      85	5	59
      91	47	68
